import React from "react";
import "./Teams.css";

const Teams = () => {
  return (
    <div className="Teams">
      <div className="left-h">
        <span>Our Team</span>
        <span className="stroke-text">What</span>
        <span>We Do</span>
      </div>
      <div className="right-h"></div>
    </div>
  );
};

export default Teams;
